import React from 'react';
import { motion } from 'framer-motion';

export default function HeroBanner() {
  return (
    <div className="text-center py-5">
      <motion.h1
        className="display-4 fw-normal"
   initial={{
    opacity:0.2,
    color: 'darkgreen'

   }}
        animate={{
            opacity:1,
          scale: 1.5,
          color: 'darkgoldenrod',
          textShadow: '1px 1px 1px black'
          
        }}
        transition={ {
            duration:0.5,
            delay:1
            }  }
      >
        Bienvenue to website
      </motion.h1>
    <div>
          <motion.p>
      "Luffy, le héros de One Piece, possède des pouvoirs élastiques grâce au Fruit Gomu Gomu no Mi,
       rendant son animation dynamique et exagérée. Ses mouvements reflètent son énergie débordante 
       et sa détermination inébranlable
      </motion.p>
    </div>
    </div>
  );
}
